from wagtail.contrib.modeladmin.options import (    ModelAdmin, modeladmin_register)from .models import Doctorclass DoctorAdmin(ModelAdmin):    model = Doctor    menu_label = 'Doctor'    menu_icon = 'pilcrow'    menu_order = 200    add_to_settings_menu = False    exclude_from_explorer = False    list_display = ('name', 'last_name', 'specialisation', )    list_filter = ('specialisation', )    search_fields = ('name', 'last_name', 'specialisation', )modeladmin_register(DoctorAdmin)